    <div className='px-24 text-black'>
        <div className='flex py-16 justify-between'>
            <h2 className='font-bold text-2xl'>MyBlog</h2>
            <ul className='flex w-1/12 text-xl justify-between'>
                <li>Login</li>
                <li>Register</li>
            </ul>
        </div>
        <div>
            {blogs.map((blog)=>{
                <Card blog={blog}/>
            })}
        </div>
    </div>
  )
}

export default Home
